import React from 'react'
import { useHistory } from 'react-router-dom'
import './styles'
import { BTrird } from './styles'

interface IButton {
  name: String,
  placeholder: S
}

const ButtonTrird: React.FC<IButton> =(
  name,
  placeholder
) =>{
  
  const history = useHistory();
  const handleClick = () => {
    history.push('/entrar')
  }  

  return (
<BTrird>
<button className="btn third" onClick={handleClick} > Click here! </button>
</BTrird>
  )
}

export default ButtonTrird
